#include <vector>
#include <unordered_map>
#include <cmath>

using namespace std;

class Solution {
public:
    long long maximumSum(vector<int>& nums) {
        unordered_map<int, long long> primeFactorsSum;
        for (int num : nums) {
            int product = 1;
            for (int i = 2; i * i <= num; ++i) {
                if (num % i == 0) {
                    int count = 0;
                    while (num % i == 0) {
                        num /= i;
                        ++count;
                    }
                    if (count % 2 != 0) product *= i;
                }
            }
            if (num > 1) product *= num;
            primeFactorsSum[product] += product;
        }

        long long maxSum = 0;
        for (const auto& [_, sum] : primeFactorsSum) {
            maxSum = max(maxSum, sum);
        }
        return maxSum;
    }
};
